var Crypto = require('crypto');
var fs = require('fs');
var content = fs.readFileSync('../../frontend/protocol.json').toString();
console.log(content.length);
console.time(1);
var md5 = Crypto.createHash('md5');
md5.update(content);
var md5Str = md5.digest('hex');
console.timeEnd(1);
console.log(md5Str);